import React, {useEffect} from 'react';
import Container from "../../Components/Container/Container";
import {useHttp} from "../../Hooks/http.hook";

const RopesInStock = () => {
    const {loading, error, request} = useHttp();

    useEffect( () => {
        const ropesInStock =  request('http://localhost:8000/api/ropes/getAllRopes', 'GET')
        console.log(ropesInStock);
    }, [loading, request]);

    return (
        <Container>
            <div>
                Ropes in stock page
            </div>
        </Container>
    );
};

export default RopesInStock;
